			require("../../../../assets/Test/CIFAR10_ResNet/Bounce/untargeted_l2/Sample1/*.jpg")
		);
    const ImgTag = ref(0);
    const playImg2 = ref("");
    const images2 = import.meta.globEager(
        require("../../../../assets/Test/CIFAR10_ResNet/HSJA/untargeted_l2/Sample1/*.jpg")
    );
    
    return (
        <>
            <div id="change">
                <div className="images">
                    <img src={playImg} className="image" alt="pic" />
                    <img src={playImg2} className="image" alt="pic" />
                </div>
                <div className="process">进度：{ImgTag}</div>
            </div>
        </>
    );
}
